    n = int(stdin.readline().strip())
    edges = []
    for _ in range(n - 1):
        a, b = map(int, stdin.readline().strip().split())
        edges.append((a, b))

    def dfs(start, seen, used):
        if start in seen:
            return 0
        seen.add(start)
        for neighbor in edges[start]:
            if neighbor not in used:
                used.add(neighbor)
                count = max(dfs(neighbor, seen, used), 1 + dfs(neighbor, seen, used))
                used.remove(neighbor)
                return count
        return 0

    start = 0
    used = set([start])
    count = dfs(start, used, used)
    max_count = 0
    for i in range(1, n):
        for j in range(i + 1, n):
            if i!= j and i in used and j in used:
                count1 = dfs(i, used, used)
                count2 = dfs(j, used, used)
                if count1 >= count2:
                    max_count = max(max_count, count1 + count2)
                else:
                    max_count = max(max_count, count2 + count1)

    return str(max_count)

