class Star:
    def __init__(self, row, col):
        self.row = row
        self.col = col
        self.size = 1

    def intersects(self, star):
        return self.row == star.row and self.col == star.col

    def is_empty(self):
        return not stars[self.row][self.col]

    def shift(self, row, col):
        new_row = self.row + row
        new_col = self.col + col

        if 0 <= new_row < n and 0 <= new_col < m:
            if stars[new_row][new_col] is None:
                return Star(new_row, new_col)
            else:
                return self.shift(row, col)
        else:
            return None

