    A, B, K = map(int, stdin.strip().split())

    def is_divisible(num: int) -> bool:
        return num % A == 0 and num % B == 0

    def partition(nums: List[int]) -> int:
        pivot_index = nums.index(max(nums))
        pivot = nums[pivot_index]
        nums[pivot_index], nums[len(nums) - 1] = nums[len(nums) - 1], nums[pivot_index]
        return pivot_index

    def kth_largest(nums: List[int], k: int) -> int:
        pivot_index = partition(nums)
        left = nums[:pivot_index]
        right = nums[pivot_index:]

        left_count = sum(is_divisible(x) for x in left)
        right_count = sum(is_divisible(x) for x in right)

        if k <= left_count:
            return kth_largest(left, k)
        elif k <= right_count:
            return kth_largest(right, k - left_count - right_count)
        else:
            return nums[pivot_index]

    return str(kth_largest([A, B], K))

